/* **************************************** */
/*          INSTRUCCIONES INICIALES         */
/* **************************************** */
SET CLIENT_ENCODING TO 'UTF8';

/* **************************************** */
/*                 ESQUEMA                  */
/* **************************************** */

-- pais
create table public.pais (
  id bigint primary key not null,
  nombre character varying(100) not null
);
create unique index pais_nombre_key on pais using btree (nombre);
create index pais_nombre_like on pais using btree (nombre);

-- cliente
create table public.cliente (
  id bigint primary key not null,
  nombre character varying(100) not null,
  apellido character varying(100) not null,
  correo character varying(254) not null,
  telefono character varying(20) not null,
  fecha_nacimiento date not null,
  pais_id bigint not null,
  foreign key (pais_id) references public.pais (id)
  match simple on update no action on delete no action
);
create unique index cliente_correo_key on cliente using btree (correo);
create unique index cliente_telefono_key on cliente using btree (telefono);
create index cliente_correo_like on cliente using btree (correo);
create index cliente_telefono_like on cliente using btree (telefono);
create index cliente_pais_id on cliente using btree (pais_id);

-- tarjeta
create table public.tarjeta (
  id bigint primary key not null,
  numero character varying(19) not null,
  cliente_id bigint not null,
  foreign key (cliente_id) references public.cliente (id)
  match simple on update no action on delete no action
);
create unique index tarjeta_numero_key on tarjeta using btree (numero);
create index tarjeta_numero_like on tarjeta using btree (numero);
create index tarjeta_cliente_id on tarjeta using btree (cliente_id);

-- giro
create table public.giro (
  id bigint primary key not null,
  nombre character varying(100) not null
);
create unique index giro_nombre_key on giro using btree (nombre);
create index giro_nombre_like on giro using btree (nombre);

-- establecimiento
create table public.establecimiento (
  id bigint primary key not null,
  nombre character varying(100) not null,
  telefono character varying(20) not null,
  giro_id bigint not null,
  pais_id bigint not null,
  foreign key (giro_id) references public.giro (id)
  match simple on update no action on delete no action,
  foreign key (pais_id) references public.pais (id)
  match simple on update no action on delete no action
);
create unique index establecimiento_telefono_key on establecimiento using btree (telefono);
create index establecimiento_telefono_like on establecimiento using btree (telefono);
create index establecimiento_giro_id on establecimiento using btree (giro_id);
create index establecimiento_pais_id on establecimiento using btree (pais_id);

-- transaccion
create table public.transaccion (
  id bigint primary key not null,
  fecha timestamp with time zone not null,
  monto numeric(10,2) not null,
  es_fraude boolean not null,
  cliente_id bigint not null,
  establecimiento_id bigint not null,
  tarjeta_id bigint not null,
  foreign key (cliente_id) references public.cliente (id)
  match simple on update no action on delete no action,
  foreign key (establecimiento_id) references public.establecimiento (id)
  match simple on update no action on delete no action,
  foreign key (tarjeta_id) references public.tarjeta (id)
  match simple on update no action on delete no action
);
create index transaccion_cliente_id on transaccion using btree (cliente_id);
create index transaccion_establecimiento_id on transaccion using btree (establecimiento_id);
create index transaccion_tarjeta_id on transaccion using btree (tarjeta_id);

